import React, { useEffect } from 'react';
import ProgressBar from 'progressbar.js';  // Import the ProgressBar library

const About = () => {
  useEffect(() => {
    // JavaScript to initialize the progress bars when the component mounts
    const progressBars = document.querySelectorAll('.circle');

    progressBars.forEach(bar => {
      const percent = bar.getAttribute('data-percent');
      const progress = new ProgressBar.Circle(bar, {
        color: '#CF1F1F',
        strokeWidth: 10,
        trailWidth: 10,
        duration: 1400,
        easing: 'easeInOut',
        from: { color: '#eaeaea', width: 10 },
        to: { color: '#CF1F1F', width: 10 },
        text: {
          value: percent + '%',
          style: {
            color: '#333',
            position: 'absolute',
            top: '50%',
            left: '50%',
            transform: 'translate(-50%, -50%)',
            fontSize: '1.2rem',
            fontWeight: 'bold',
          }
        },
        step: (state, circle) => {
          circle.path.setAttribute('stroke', state.color);
          circle.path.setAttribute('stroke-width', state.width);
        }
      });

      progress.start(percent / 100);
    });
  }, []); // Empty dependency array ensures this only runs once when the component mounts

  return (
    <section id="section-about">
      <div className="container">
        <div className="row">
          <div className="col-md-12 text-center">
            <h2>About Me</h2>
            <div className="space-border"></div>
          </div>
          <div className="col-md-8 offset-md-2 text-center">
            <p>
              I am a website designer from Louisiana, with a strong focus on UI/UX design. I love to get new experiences and always learn from my surroundings. I've done more than 285 projects. You can check it through the portfolio section on this website. I look forward to any opportunities and challenges.
            </p>
          </div>
          <div className="col-lg-3 position-relative">
            <div className="progressbar">
              <div className="circle" data-percent="90">
                <canvas width="200" height="200"></canvas>
                <div>90.0%</div>
              </div>
              <h4>HTML</h4>
            </div>
          </div>
          <div className="col-lg-3 position-relative">
            <div className="progressbar">
              <div className="circle" data-percent="85">
                <canvas width="200" height="200"></canvas>
                <div>85.0%</div>
              </div>
              <h4>CSS</h4>
            </div>
          </div>
          <div className="col-lg-3 position-relative">
            <div className="progressbar">
              <div className="circle" data-percent="80">
                <canvas width="200" height="200"></canvas>
                <div>80.0%</div>
              </div>
              <h4>PHP</h4>
            </div>
          </div>
          <div className="col-lg-3 position-relative">
            <div className="progressbar">
              <div className="circle" data-percent="75">
                <canvas width="200" height="200"></canvas>
                <div>75.0%</div>
              </div>
              <h4>jQuery</h4>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
